        React.createElement("path", { d: "M3 7a1 1 0 011-1h16a1 1 0 110 2H4a1 1 0 01-1-1z", fill: primaryFill }),
        React.createElement("path", { d: "M3 13a1 1 0 011-1h16a1 1 0 110 2H4a1 1 0 01-1-1z", fill: primaryFill }),
